import React from 'react'
import Post from './Post'
export default function Feed({posts}) {
  return (
    <>
      {posts?.map((post =>(   
        <Post item key={post.id} post={post}  item xs={12} sm={6} md={4} lg={3} />
      ) )  ) }
    </>
  )
}
